(119, '192.168.7.55', 244, 0, 0, 0, 0, 2, 1, 0, 1, 'data:image/png;base64,', 2, 'Otonomda hiçbirşey yapmadı. İki robotu aynı anda savunmaya çalıştı ama diğerini kaçırdı. Climbda mid runga tırmandı. Büyük cüssesi sayesinde rekabete girebiliyor ve dayanabiliyor. Ama cüssesine göre sağlam değil.', 0, 0),
(120, '192.168.7.55', 8082, 0, 0, 0, 0, 0, 0, 0, 1, 'data:image/png;base64,', 2, 'Defans robotu ama sahada hiçbir şey yapmadı. Savunmada pek etkilemese de sadece diğer robotu ittirdi.', 0, 0),
