(122, '192.168.5.10', 6485, 0, 0, 0, 2, 2, 1, 1, 0, 'data:image/png;base64,', 2, 'Sadece otonomda 2 tane top atabildi onun dışında hiçbir şey yapmadı. Ne defans ne top atma. Sadece robot açısından tırmanma iyiydi.', 8, 0);
