(176, '192.168.7.71', 624, 0, 0, 5, 4, 2, 1, 1, 0, 'data:image/png;base64,', 1, 'Attack robotu ve climb olarak mide tırmandı. Nişan almayı pek beceremiyor ama swerve olmasından dolayı hızlı ve topu alıp çabucak atabiliyor bu da onun için bir avantaj. Diğer takımlar onunla genellikle uğraşıyor ve hızı sayesinde onlardan kaçabiliyor.', 26, 0),
(177, '192.168.7.109', 1477, 0, 0, 3, 0, 4, 1, 1, 0, 'data:image/png;base64,', 1, 'Robotun shooter sistemi çok iyi değil. Gelişebilir. İntake biraz daha hızlı olursa iyi olabilir. Nişan almaları gelişebilir. Ancak robotun tırmanma mekanizması mükemmel. Biraz daha defans yapmalı. Defansı yoktu.', 6, 0),
