(181, '192.168.7.71', 2881, 0, 0, 10, 0, 4, 1, 1, 0, 'data:image/png;base64,', 2, 'Robot otonomda pek bir şey yapmadı ama onun dışında sayı üretti. İsabet yüzdesi çok kötü değil, aynı zamanda büyük ve normal hızda bir robot.', 20, 0),
(182, '192.168.7.109', 1477, 0, 0, 2, 0, 4, 1, 1, 0, 'data:image/png;base64,', 2, 'Robotun shooter sistemi çok iyi değil. Çünkü nerdeyse attığı bütün toplar hubın içinden dışarı çıktı. Gelişebilir. İntake biraz daha hızlı olursa iyi olabilir. Nişan almaları gelişebilir. Ancak robotun tırmanma mekanizması mükemmel. Ayrıca Biraz daha defans yapmalı. Defansı yoktu.', 4, 0),
