(184, '192.168.2.216', 5089, 0, 0, 0, 1, 1, 1, 1, 1, 'data:image/png;base64,', 1, 'ortalama bir defans. hiç bir şey kullanmıyor. seçmeyelim bu ne aaaaa', 4, 0),
(185, '192.168.5.142', 7287, 0, 0, 5, 1, 2, 1, 1, 0, 'data:image/png;base64,', 2, 'Robot attack robotu ancak yakın mesafeye gelmeden atamıyor ve oyun içinde genellikle mid bara tırmanmasından daha önemli birşey yok. Oyun stili aybnı, otonomda 1 top atıyor ve daha sonrasında geriye gidiyor. Ayrıca oyunun bir kısmında da driverı ne yapacağını bilemiyor ve hangara gidecekken huba gitmeyi çok uzun sürede karar veriyor ve zaman kaybediyor.', 14, 0);
