(186, '192.168.6.25', 6486, 4, 2, 0, 0, 0, 0, 1, 0, 'data:image/png;base64,', 2, 'Her zaman low huba atmaya yönelikti. Bu bir dezavantaj. Çünkü hem hıgh hem de low huba top atmamız gerekir. Nişan almaları çok iyi değildi. Daha iyi olabilir. Shooter kötü değil ama geliştirilebilir. İntake biraz daha hızlı açılabilir. Ve defans ve tırmanma yaparsa daha iyi olur.', 8, 0),
